INSERT INTO `competency` (`id`, `name`, `percentage`, `agentPercentage`, `definitions`, `acrossTheBoard`, `created_at`, `updated_at`) VALUES
(1, 'Attendance &amp; Punctuality', 0, '4.03', '<ul><li>Maintains assigned work schedule</li>\n     <li>Considers arrival time</li>\n     <li>Observance of time limits for breaks and lunches</li>\n     <li>Patterns of sick leave</li>\n     <li>Prompt notice of absence due to illness</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(2, 'Adaptability', 5, '2.88', '<ul><li> Handles pressure smoothly and productively</li>\n     <li>Makes excellent decisions even with minimal information</li>\n     <li>Adapts rapidly to changing circumstances and uses his judgment, experience and positive outlook to help the team through challenges.</li>\n     <li>Listens carefully to others.  When new ideas come up, he is ready to evaluate them and alter his approach to accomplish the goals better.</li></ul>', 1, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(3, 'Communication', 12, '6.91', '<ul><li>Communicated very well with others</li>\n                <li>Organizes his thoughts and expresses himself in a clear and understandable way.</li>\n                <li>Documents and reports are always factual, informative, interesting and easy to read.  Promotes an atmosphere where all team members feel comfortable sharing and discussing their ideas.</li>\n                <li>Conscientious about updating others on developments, plans and activities.</li>\n                </ul>', 1, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(4, 'Decision Making', 7, '0.00', '<ul><li>Has excellent command of decision making-techniques and applies them appropriately.</li>\n     <li>Makes consistent, productive decisions and rarely back away from difficult decisions.</li>\n     <li>Considers all information available when making a decision, and as a result makes solid, supportable decisions</li>\n     <li>Always considers the impact of his decisions on others within the department and organization.</li>\n     <li>Solicits input and takes steps to minimize any unfavorable effect with his decisions.</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(5, 'Problem Solving', 10, '5.76', '<ul><li>Quickly recognizes potential problems</li>\n     <li>Able to sift through problems and distinguish unimportant or irrelevant issues from key components.</li>\n     <li>Quickly responds to potential problems.</li>\n     <li>Analyzes problems and takes immediate action before problems fully develop.</li>\n     <li>Finds creative ways to overcome obstacles by developing more than one solution.</li>\n     <li>Actively participates in group problem-solving efforts</li>\n     <li>Contributes insightful ideas and facilitates the process by supporting the exchange of ideas and information within the department or with other departments.</li></ul>', 1, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(6, 'Results Focus & Work Proficiency', 14, '26.50', ' <ul>\n<!-- <li> Highly focused , consistently gets results.</li> -->\n\n<li>Achieves program targets and goals.</li>\n     <!-- <li>Can manage competing demands on his time and remains focused on key objectives.  Prioritizes tasks to ensure achievement of objectives.</li> \n\n     <li>Understand relative importance of projects assigned to him.</li>-->\n\n<li> Prioritizes tasks to ensure achievement of objectives.</li>\n\n<li>Maintains consistent or progressive numbers that contribute to overall program performance.</li>\n     \n<li>Readily accepts accountability for his own actions</li>\n\n<li>Displays the appropriate level of proficiency in one''s field through work results.</li>\n\n<!--      \n<li>Able to get results by demonstrating the appropriate level of proficiency in one''s field. </li> -->\n\n<li>Demonstrates a commitment to continuous improvement. <!-- , to include understanding and application of technology (hardware, software, equipment and processes) in their respective role and field. --> </li>\n\n<li>Employee''s numbers reflect product/service knowledge and proficiency.</li></ul>\n', 1, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(7, 'Leadership', 12, '0.00', '<ul><li>A persuasive leader who presents and sells his ideas in a well-organized fashion and supports it with clear and compelling arguments.</li>\n     <li>Is even-handed, showing no favoritism.</li>\n     <li>Establishes a clear direction</li>\n     <li>Sets clear team objectives</li>\n     <li>Communicates expectation</li>\n     <li>Uses good tracking techniques</li>\n     <li>Maintains strict quality standards</li>\n     <li>Diligent about meeting deadlines   </li>\n     <li>Supportive of company leadership and conscientious about implementing organizational policies.  </li>\n     <li>Well-respected by subordinates and colleagues</li>\n     <li>Inspires enthusiasm  in his group</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(8, 'Planning', 5, '2.88', '<ul><li>Develops effective and achievable plans that are aligned with the organization/corporate plans/objectives.</li>\n     <li>Establishes overall goals and determines steps required to reach these.</li>\n     <li>Formulates initial strategies and tactics.</li>\n     <li>Shows judgment and flexibility in re-adjusting them as necessary</li> \n     <li>Able to balance short and long-range plans to support overall goals.</li>\n     <li>Keeps other areas well informed    </li>\n     <li>Clearly defines necessary resources/budgets.</li>\n     <li>Gets resources and support commitments when necessary to ensure smooth implementation and cooperation from others. </li>\n     <li>Anticipates potential obstacles and develops excellent contingency plans.</li></ul>', 1, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(9, 'People Management', 10, '0.00', '<ul><li>Creates a supportive climate that inspires the employees to achieve excellence.</li>\n     <li>Ready to coach and give advice.  Makes sure that team members know exactly what is expected of them.</li>\n     <li>Builds a productive team that functions smoothly.</li>\n     <li>Delegates wisely and effectively.  Understands the abilities of team members and gives each an appropriate level of independence. </li>\n     <li>Actively involves his employees in decision making by soliciting their suggestions and input.</li>\n     <li>Acknowledges and supports good ideas.</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(10, 'People Development', 10, '0.00', '<ul><li> Committed to his employees'' professional development.</li>\n     <li>Strongly encourages growth</li>\n     <li>Discusses long-term development needs of his staff</li>\n     <li>Gives detailed feedback and an honest assessment of staffs'' strengths and weaknesses.  Establishes expectations and praises strong performance and hard work done by his team.</li>\n     <li>Looks for new ways to reward and motivate the team/staff and offers firm support for their efforts. </li>\n     <li>Provides challenging opportunities and encourages innovation by recognizing those who take risks. </li> </ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(11, 'Managing Performance', 10, '0.00', '<ul><li>Handles performance problems decisively</li>\n     <li>Acting promptly to settle issues when they arise.</li>\n     <li>Deals with consistency and objectively with employees who do not meet the requirements. </li>\n     <li>Takes positive improvement-focused approach to performance problems and confines criticism to specific actions or incidents.</li>\n     <li>Defines concrete steps an employee can take to remedy performance.</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(12, 'Meeting Management', 5, '0.00', '<ul><li>Holds an optimal number of meetings and makes sure that each meeting has a well-defined purpose.</li>\n     <li>Sets clear agendas and goals and keeps focused on the agenda.\n     <li>Analyze issues and people involved.\n     <li>His meetings are productive and have a clear focus\n     <li>Prepares for meetings. \n     <li>Encourages and balances input, including their own.\n     <li>Shows excellent judgment in deciding when information and opinions should be exchanged in a meeting or through other channels.</li></ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(13, 'Teamwork & Team Focus', 0, '4.03', '<ul>\n<!-- <li>Works cooperatively and effectively with others to achieve group goals.  </li> -->\n<li>Participates in building a group identity characterized by trust, commitment, and enthusiasm.</li>\n<li>Cooperates by using individual skills and contributing to a common cause.</li>\n<li>Provides constructive feedback, <!-- despite personal conflict between individuals. --> </li>\n<li>Works out differences among team members or other groups.</li>\n<!-- <li>Communicates clearly so the common aim is achieved.</li> -->\n<li>Respects individual contributions, but also gives input for the advancement of the team.\n</li>\n<li> Initiates and/or participates in consensus-building.</li>\n\n<!--\n <li>Puts aside individual credit or distinction for the greater good.</li> --> </ul>', 0, '2017-07-19 13:38:07', '2017-07-19 13:38:07');
