(1, 1, 1, 3, 'ATTENDANCE FOR PERIOD:  June 13 - December 13, 2016\nJuly 14 sick\nJuly 15 sick\nOctober 13 lwop: personal\nNov. 2 sick\nDec. 9 lwop: personal\n_______________________\nTOTAL:  5  ', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(2, 1, 2, 3, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(3, 1, 3, 2, 'â€¢ Able to work independently, with minimal supervision.\n  â€¢ Built trust and rapport with other team members and departments.\n  â€¢ Positive attitude towards personal work ethic, and pushes team towards greater good.\n          Listens carefully.', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(4, 1, 4, 2, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(5, 1, 5, 2, 'Â· Linear approach to data management and analysis contributes performance and reporting accuracy.\n  Â· Translates and captures concepts and data to measurable and relatable templates/reports.\n  Â· Organized.\n           Able to explain, visualize, and justify analytical and linear approach.\n  Â· Conscientious in documenting, updating, and cascading.\n\n      * Spread influence to other departments and members of the org. ', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(6, 1, 6, 2, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(7, 1, 7, 3, 'Â· Able to work independently and make decisions with minimal supervision, but with proper authorization and approval.\n\n  â€¢ Logical and rational approach in making decisions\n  â€¢ Diplomatic, fair, objective.\n        *Always keeping in mind team welfare and goals. ', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(8, 1, 8, 3, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(9, 1, 9, 2, 'Â· Able to work independently and solve problems with minimal supervision, but with proper authorization and approval.\n\nÂ·  Logical and rational approach in solving issues and challenges.\n\nAware that actions and behavior impact team and org as a whole, never only on an individual level.  ', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(10, 1, 10, 2, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(11, 1, 11, 2, 'â€¢ Very focused on procedure and processes, as her job requires.\nâ€¢ Project development and implementation managed well.\nâ€¢ Good time management.\nâ€¢ Aware of accountability and own up to responsibilities\nâ€¢ Able to get results through his team members.\n\nCheckpoint:\nYou are empowered to expand your ability to follow up with other segments of the team.  Follow through to the end, until targeted results are achieved.\nDon''t be shy to follow up with team and other departments.', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(12, 1, 12, 2, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(13, 1, 15, 3, 'Develops effective and achievable plans that are aligned with the organization/corporate plans/objectives.\nAble to balance short and long-range plans to support overall goals.\nKeeps other members/segments well informed.\n\nCheckpoints:\nAs you expand in support, develop proactively more process-improvement and problem-solving initiatives.\nYou are encouraged to begin spear-heading more initiatives.  ', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(14, 1, 16, 3, '', '2017-01-22 00:07:05', '2017-01-22 00:07:05'),
(15, 2, 1, 4, 'Absenteeism and HRIS management:\nABSENCES\nJuly 8 sick\nJuly 15 sick\nJuly 18-20 sick       \n*Total July:   5\n \nAugust 16-19  sick\n*Total August:   4\n \nSeptember 16 family emergency\nSeptember 30 sick\n*Total September:    2\n_______________________________\n**TOTAL (6 months):  11 absences ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(16, 2, 2, 4, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(17, 2, 3, 3, 'Generally listens to instructions.  Shares ideas and feedback openly.  \nTakes some time to adapt to new processes, specially reporting. ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(18, 2, 4, 3, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(19, 2, 5, 2, 'Commendable ability to provide specific and detailed feedback.  Just needs to remember to always use \nobjective language. especially when describing negative behavior.  Needs to also be more conscientious to \nrespond to emails with immediacy.  Part of multi-tasking. ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(20, 2, 6, 2, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(21, 2, 7, 3, 'Checkpoint/Area for growth - When absent, be more thorough in endorsing and delegating tasks/agenda to your sub; as an absence impacts the team and class.\n \nDid well in the other areas.', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(22, 2, 8, 3, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(23, 2, 9, 3, 'Generally, follows team processes and workarounds.  Contribute more by proactively presenting ideas for better solutions.  ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(24, 2, 10, 3, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(25, 2, 11, 3, 'Great job on individual projects like Taxonomy Job Aid, Anatomy of a Chat, CCCT DD customization.  \nTeam projects took a little longer and more supervision to complete.\n  ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(26, 2, 12, 3, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(27, 2, 15, 3, 'She did well in following through with team plans and individual contributions.  Area for growth:  Push towards formulating strategies, tactics, and plans to support goals.  Also work on more proactively communicating, reporting updates.  ', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
(28, 2, 16, 3, '', '2017-01-22 00:09:29', '2017-01-22 00:09:29'),
