(437, 44, 3, 3, 'Attila needs minimal supervision especially when making a decision on how to resolve certain cases or concerns of his callers. With the knowledge and experience he already have for the past 6 months, I know that I can rely on him in regards in helping the team to go up. However, I can see that he is having some challenges in handling pressure or changes. A bit reluctant but with some explanations and clarifications, I am confident that he will be able to adapt to it.', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(438, 44, 4, 3, '', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(439, 44, 5, 2, 'I could say that Attiila likes to communicate and express himself. He is conscious about his grammar and the words to use especially that English is not his mother tongue. There were just some instances wherein he will start conversing in Hungarian even if there''s someone that cannot speak or understand his language.', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(440, 44, 6, 2, '', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(441, 44, 9, 1, 'I can confidently say that Attila is one of my agents who can quickly recognize potential problems and those who are already existing but no one is giving time to see it. He always have solutions to offer or work around that is realistic.', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(442, 44, 10, 1, '', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(443, 44, 11, 2, 'Attila has an excellent command of making decisions. He has the sense of logic and technicalities. He is always aiming to be productive for each day he is working. He just needs to work on with his tendency to back away from handling difficult calls when it is almost the end of his shift', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
(444, 44, 12, 2, '', '2017-02-06 13:59:30', '2017-02-06 13:59:30'),
