(464, 38, 2, 1, '', '2017-02-07 14:06:46', '2017-02-07 14:06:46'),
(465, 38, 3, 4, 'Zuzanna''s presence is not much felt within the team as she works from home. Her ideas are not being heard and nor her ability to decide is not being established', '2017-02-07 14:06:46', '2017-03-01 18:29:51'),
(466, 38, 4, 4, '', '2017-02-07 14:06:46', '2017-02-07 14:06:46'),
(467, 38, 5, 4, 'For the past 6 months, the team never heard anything from her. We are not sure what''s her idea or suggestions with the updates and changes going on in the account. ', '2017-02-07 14:06:46', '2017-02-07 14:06:46'),
(468, 38, 6, 4, '', '2017-02-07 14:06:47', '2017-02-07 14:06:47'),
(469, 38, 9, 4, 'Most of the time, she will assign email cases to me as it is difficult to handle. She should have exhausted all possible resources especially SharePoint and could also try to think outside the box to find a solution', '2017-02-07 14:06:47', '2017-03-01 18:29:51'),
(470, 38, 10, 4, '', '2017-02-07 14:06:47', '2017-02-07 14:06:47'),
