(473, 38, 15, 4, 'Zuzanna needs to be more independent in working with her tasks', '2017-02-07 14:06:47', '2017-03-01 18:29:51'),
(474, 38, 16, 4, '', '2017-02-07 14:06:47', '2017-02-07 14:06:47'),
(475, 38, 25, 5, 'Since Zuzanna is working from home, there''s not much of interaction between her team mates. Team work is not being establish which consists of interacting with each other', '2017-02-07 14:06:47', '2017-03-01 18:29:51'),
(476, 38, 26, 5, '', '2017-02-07 14:06:47', '2017-02-07 14:06:47'),
(477, 86, 1, 1, 'In terms of being punctual, Edward is consistently early with his work schedule. Once he is in the office, he makes sure that all of his systems are up and running. He observed his break and lunch schedule as well. He also notifies me right away if there''s any issue/s that happened while he is on break', '2017-02-07 15:07:56', '2017-02-07 15:07:56'),
(478, 86, 2, 1, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(479, 86, 3, 3, 'Edward is a person that listens and follows what is being instructed him to do specifically if it is regarding his performance. He just needs to handle pressure and stress smoothly and in a more positive manner. ', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(480, 86, 4, 3, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(481, 86, 5, 2, 'Edward get along with his team mates. He communicated well and knows how to use the necessary language for his work. Documentation in the account being handled are very detailed. He just needs to be aware of his tendency to intimidate or to create negativity from his other colleagues preventing them to share their ideas.', '2017-02-07 15:07:57', '2017-03-08 20:27:53'),
(482, 86, 6, 3, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(483, 86, 9, 3, 'Edward tends to focus first on the problem rather than finding a resolution for it. But after venting out, he will then proceed in finding a work around for the problem he is facing.', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(484, 86, 10, 3, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(485, 86, 11, 2, 'One thing that is good about Edward is that he is very accountable with his actions and with the resolution he is giving to the callers. When he noticed that he did something wrong, he will admit it and will find a resolution. He just needs to be more focus on achieving the goal set for the handling time. ', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(486, 86, 12, 2, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(487, 86, 15, 3, 'When being asked about his plan on how to achieve the goal, he will not share his ideas. He is more on just getting your ideas and follow it. Edward should also learn how to share his ideas and give his own way of reaching the goal.', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(488, 86, 16, 3, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(489, 86, 25, 2, 'Edward is a team player. He knows how to work within the team. He just needs to learn how to get along with everyone and not just with the people he wants to be friends with.', '2017-02-07 15:07:57', '2017-03-08 20:27:53'),
(490, 86, 26, 3, '', '2017-02-07 15:07:57', '2017-02-07 15:07:57'),
(491, 87, 1, 2, 'Damian did not commit any attendance violation. He is always following his work schedule. However, he tends to do over break/lunch', '2017-02-07 16:49:27', '2017-03-01 18:32:55'),
(492, 87, 2, 2, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
(493, 87, 3, 3, 'Damian only needs minimal supervision in terms of product knowledge. However, having some difficulties in facing change and in realizing that everything is for the better of the campaign.', '2017-02-07 16:49:27', '2017-02-08 11:30:15'),
(494, 87, 4, 3, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
(495, 87, 5, 3, 'Damian doesn''t have any issues in terms of communicating and expressing himself. In fact, he is one of my agents who is very transparent. However, he has this tendency to make others feel awkward in expressing themselves with his strong personality.', '2017-02-07 16:49:27', '2017-02-08 11:30:15'),
(496, 87, 6, 3, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
(497, 87, 9, 3, 'Damian can recognize potential problems and is proactive in giving his ideas on how it can be resolved. He just needs to be more serious in cascading it or expressing himself', '2017-02-07 16:49:27', '2017-02-08 11:30:15'),
(498, 87, 10, 3, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
(499, 87, 11, 3, 'Damian is always on the goal. I cannot say any negative on how he is maintaining his metrics in line with what the client is asking. However, he needs to be more accountable for his actions. ', '2017-02-07 16:49:27', '2017-02-08 11:30:15'),
(500, 87, 12, 3, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
(501, 87, 15, 3, 'Damian has the ability to see potential issues and can think of a work around. ', '2017-02-07 16:49:27', '2017-03-01 18:32:55'),
(502, 87, 16, 3, '', '2017-02-07 16:49:27', '2017-02-07 16:49:27'),
