(1071, 112, 1, 1, 'CSR is committed to work, arrives early. VL are well planned.', '2017-02-09 09:57:28', '2017-02-09 09:57:28'),
(1072, 112, 2, 1, 'CSR agrees to the feedback', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1073, 112, 3, 1, 'CSR is able to handle task despite of the language barrier.\nVery independent, tries her best to understand all processes', '2017-02-09 09:57:28', '2017-02-14 09:06:57'),
(1074, 112, 4, 2, 'CSR agrees to the feedback', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1075, 112, 5, 2, 'Comes to supervisor/department head with any questions that employee does not know off-hand.\n', '2017-02-09 09:57:28', '2017-02-14 09:06:58'),
(1076, 112, 6, 2, 'CSR believes that she have space to improve her communication  not just in language but to others as well', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1077, 112, 9, 2, 'Displays strong analytical skills.\nConducts research or seeks counsel of experts to gather information  needed in making actual decisions.\n', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1078, 112, 10, 2, '', '2017-02-09 09:57:28', '2017-02-09 09:57:28'),
(1079, 112, 11, 2, 'QA 98.27% +AHT 95.94% = 97.10%\n', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1080, 112, 12, 3, 'CSR struggled in AHT during this time due to lack of man power. Only 1 Thai CSR is supporting  the queue,\n', '2017-02-09 09:57:28', '2017-02-15 02:58:01'),
(1081, 112, 15, 2, 'CSR gets the most out of scarce resources.\nShould anticipate problems before they occur.', '2017-02-09 09:57:28', '2017-02-14 09:06:58'),
(1082, 112, 16, 2, 'CSR agrees on the feedback', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1083, 112, 25, 2, 'CSR sets an example for subordinates in following departmental and university policy and procedures\nAs a Senior CSR should draw knowledge and skills of others.\n', '2017-02-09 09:57:28', '2017-02-14 09:06:58'),
(1084, 112, 26, 2, 'CSR tends to be very focused on her own task when she is busy .', '2017-02-09 09:57:28', '2017-02-14 10:08:25'),
(1085, 122, 1, 1, 'CSR is very committed to work.\nArrives to work early\nVL are well planned and tries to notify ahead of time', '2017-02-09 10:06:25', '2017-02-09 10:06:25'),
(1086, 122, 2, 1, 'CSR will be time cautious and observe break schedule', '2017-02-09 10:06:25', '2017-02-28 07:58:32'),
(1087, 122, 3, 3, 'Adapted to new systems and processes well.Usually needs direct supervision and confirmation.\nShould be ready to face with any change in circumstances.\n', '2017-02-09 10:06:26', '2017-02-10 05:30:25'),
(1088, 122, 4, 3, 'CSR is aware that she  always needed confirmation and assurance', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1089, 122, 5, 2, 'coworkers feel comfortable coming to this employee with questions and comments.Department head has received a few complaints about the CSR (Phone manner)', '2017-02-09 10:06:26', '2017-02-10 06:28:32'),
(1090, 122, 6, 2, 'CSR tends to be very silent , she usually focus on her own stuff', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1091, 122, 9, 3, 'CSR is able to solve most of her task. However, most of the time needed confirmation and assurance from teammates or co-workers.', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1092, 122, 10, 3, 'CSR mentioned she always tries her best to recognize and identify problems.', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1093, 122, 11, 3, 'QA 95.06% + AHT 81.85%= 88.46%\nAgent should set a goal to meet the standards\nProductivity and knowledge wise is good', '2017-02-09 10:06:26', '2017-02-10 05:30:25'),
(1094, 122, 12, 3, 'CSR is aware of the goals set by mgt. She is focused on how to handle and deliver results to the customers and forgets about other goals', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1095, 122, 15, 3, '', '2017-02-09 10:06:26', '2017-02-09 10:06:26'),
(1096, 122, 16, 3, '', '2017-02-09 10:06:26', '2017-02-09 10:06:26'),
(1097, 122, 25, 2, 'Available when needed and has an open door policy for subordinates.\nShould develop more on the ability to explain and teach.', '2017-02-09 10:06:26', '2017-02-10 05:30:25'),
(1098, 122, 26, 3, 'CSR understands that it is important to educate other teammates than spoon feeding them with information they needed', '2017-02-09 10:06:26', '2017-02-28 07:58:32'),
(1099, 123, 1, 4, 'Agent was consistently tardy month by month to the point that he got an ultimatum for not being able to notify his lead, Fort Dayao, 2 hrs prior to his scheduled shift.', '2017-02-09 10:12:25', '2017-02-09 10:12:25'),
(1100, 123, 2, 4, 'No comments. I know I was quite lacking in this field.', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
(1101, 123, 3, 2, 'Agent can adapt to any changes the campaign requires. Though some changes may be abrupt, there could be mild objection which is just a normal reaction by any agents. As per her previous TL, Carla, this slight disagreement meant that he can think of a better way of executing things. Overall, he is a smart, fast learning agent who brings quality above other agents in the group.', '2017-02-09 10:12:25', '2017-02-22 09:16:51'),
(1102, 123, 4, 3, 'I think I deserve a 4 on this aspect. I have always been an adaptable employee, even from the time TA-CS moved from email-only to being an email and voice account. Even the changes to the tools and schedules mattered little to me, except with maybe a few negative comments. During the months from July to Dec, TL Carla would let us try a bunch of different action plans to improve our stats and I had no issues with those. We even moved to a different account and I still excelled at the training even while others were still down and depressed. ', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
(1103, 123, 5, 2, 'Agent has a commendable communication skills both in writing and oral and could easily convey his thoughts. Though this may be a plus factor for the agent, but at times, he seldom interacts with his teammates.', '2017-02-09 10:12:25', '2017-02-09 11:05:50'),
(1104, 123, 6, 3, '', '2017-02-09 10:12:25', '2017-02-09 10:12:25'),
(1105, 123, 9, 2, 'Agent has adequate information thus providing alternate solution to members. He is outright open to shape his thoughts and inputs with the team during meetings and coaching, but his creative and witty suggestions often lead to potential issue with the client as it may not produce a long term solution and therefore subject to disputes. Indeed this is a strong facet of the agent but this needs constant improvement.', '2017-02-09 10:12:25', '2017-02-22 09:16:51'),
(1106, 123, 10, 2, 'I feel that I deserve a 5 for Problem Solving, especially during the months between July to Dec. 2016. This was not only evident in the cases we worked on but also on how we addressed client demands and center competition as a team during those times.  I actively participated with TL Carla in providing solutions to several of our teams problems. I am confident with how my team mates view me on this aspect. Even after being transitioned to a new account, my team mates still ask for my input even though I no longer hold any more experience than them.', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
(1107, 123, 11, 3, 'Agent tends to be out of sight on things that need to be prioritized from things that have of less importance. He oftentimes takes things for granted and lose track of what things at hand. He needs to be on close supervision to be on track.', '2017-02-09 10:12:25', '2017-02-09 10:12:25'),
(1108, 123, 12, 3, 'Despite being good in planning, communicating, and problem-solving, and adaptability, those mean nothing if we lack in implementation and consistency. So I don''t have any issue with getting just a 3 here.', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
(1109, 123, 15, 2, 'Agent is a passive type of person. He takes things and work less seriously. I see him as a person who grabs opportunities in the dark. Like someone who is blind and shoots at a target.', '2017-02-09 10:12:25', '2017-02-22 07:11:41'),
(1110, 123, 16, 3, 'Although I agree that I am generally a passive person, this was not the case during the months between July to Dec. of 2016. I participated quite a lot with TL Carla in regards to planning for ways to improving team stats and metrics. As there were a lot of changes to the system and client demands came with some unreasonable situations, I did not sit idly-by and let that stop our team. I also assisted quite a lot with the newbies and those with lower stats to help them improve. I feel that I deserve a 4 in here. I am confident that TL Carla can vouch for me in this regard.', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
(1111, 123, 25, 2, 'Agent has demonstrated participation during team building or gathering. He is not someone who has attitude problem and could easily get along with his teammates. He is willing to lend a helping hand to his teammates.', '2017-02-09 10:12:25', '2017-02-09 10:12:25'),
(1112, 123, 26, 2, 'I feel that I am someone who has always been more than willing to lend a helping hand to my team mates. Especially during the months from July to December. I know I contributed a lot of input and constructive feedback to my team lead and my team mates, which helped improve our stats. I am confident that my team mates can vouch for me regarding team work. Even after being transitioned to a new account, they still ask for my input even though I no longer hold any seniority over them.', '2017-02-09 10:12:25', '2017-02-09 11:47:37'),
