(1303, 136, 25, 2, 'As mentioned, need to express more on her thoughts and share to others. Need to be more "present" in the meetings, not just a viewer.', '2017-02-10 02:43:17', '2017-02-10 03:11:21'),
(1304, 136, 26, 2, '', '2017-02-10 02:43:17', '2017-02-10 02:43:17'),
(1305, 37, 1, 2, 'Attendance is not an issue.\nFiling leaves is also not an issue, but the pattern should be reduced.\nSome lates over the last 6 months', '2017-02-10 03:05:38', '2017-02-10 05:33:26'),
(1306, 37, 2, 1, '', '2017-02-10 03:05:38', '2017-02-10 03:05:38'),
(1307, 37, 3, 2, 'Handles pressure smoothly and productively -- need to work on this.\nMakes excellent decisions even with minimal information - this is your strength, i just need to see more initiatives.', '2017-02-10 03:05:38', '2017-02-10 05:33:26'),
(1308, 37, 4, 2, '', '2017-02-10 03:05:38', '2017-02-10 03:05:38'),
