(2073, 134, 11, 3, 'Prioritize which cases are important and have the sense of urgency.\nImprove on getting higher scores when it comes to Proficiency Exams and Quality Assurance.\n\n', '2017-02-20 17:44:00', '2017-02-20 17:44:00'),
(2074, 134, 12, 3, '', '2017-02-20 17:44:00', '2017-02-20 17:44:00'),
(2075, 134, 15, 3, 'Improve on taking ownership of cases directly assigned to him.\nBe more consistent in providing update to members.', '2017-02-20 17:44:00', '2017-02-20 17:44:00'),
(2076, 134, 16, 3, '', '2017-02-20 17:44:00', '2017-02-20 17:44:00'),
(2077, 134, 25, 2, 'Should improve in interacting with his team mates and not having his own space.', '2017-02-20 17:44:00', '2017-02-20 17:44:00'),
