(2396, 50, 2, 1, '', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2397, 50, 3, 2, '""\n\nShe can work with minimal supervision and always ready to evaluate new processes and the possible issues it may cause.She can still improve the way she handle stress more smoothly especially if there are a lot of things she has to finish.\n""', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2398, 50, 4, 2, '', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
