(2400, 50, 6, 2, '', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2401, 50, 9, 2, 'I can commend heike for doing a good job especially in probing and recognizing potential problems that may arise.Her insights and readiness to help anyone who has a complicated issues make her one of the valuable member of our team.', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2402, 50, 10, 2, '', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2403, 50, 11, 2, 'She is very focused with her work and in resolving issues at hand. Sometimes too focused that makes her stressed out if issues that need her attention pile up and affect her handling time.  ', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2404, 50, 12, 2, '', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2405, 50, 15, 3, 'Heike has the ability to achieve her goals at work and can anticipate probable issues. She is proactive in giving suggestions on how certain goal can be achieved', '2017-03-08 12:14:27', '2017-03-08 12:14:27'),
(2406, 50, 16, 3, '', '2017-03-08 12:14:28', '2017-03-08 12:14:28'),
(2407, 50, 25, 1, 'She is very active in participating with group discussions especially on how to achieve the goals for our team. She help in her own way on how to maintain a harmonious relationship within the team. ', '2017-03-08 12:14:28', '2017-03-08 12:14:28'),
(2408, 50, 26, 1, '', '2017-03-08 12:14:28', '2017-03-08 12:14:28'),
(2409, 52, 1, 1, 'Aaron has always been punctual when it comes to work and properly notify if he cannot report to work. He is also very observant with break schedules not only his but for the other members of the team which can affect the service level.', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2410, 52, 2, 1, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2411, 52, 3, 3, 'He has a tendency to be reluctant with changes (policy or process wise) but in the end he will see the reason behind it and will follow. The way he sometimes show his reluctance may indirectly influence the way the other members of the team adapt to these changes. It is good that he evaluates new ideas and it would be better if he can give a more positive outlook of things.', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2412, 52, 4, 3, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2413, 52, 5, 3, 'His communication skills can still be improved by constructing his thoughts in a more clear and concise way. He reminds the team of any update or plans that may affect the way they handle issues.', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2414, 52, 6, 3, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2415, 52, 9, 2, 'He can quickly recognize possible issues taht may arise and also gives suggestions on how to resolve it. He needs to dig deeper in investigating some issues and be more independent and confident with his decision. ', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2416, 52, 10, 2, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2417, 52, 11, 2, 'He is results focused and consistent in achieving the majority of the key performance indicators. He can improve the way he accepts accountability for his own actions because sometimes he has a tendency not to readily accept it.', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2418, 52, 12, 2, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2419, 52, 15, 2, 'He always take the initiative when it comes to planning (whether it is work-related or group activity.He gives valuable insights on how to reach certain objectives. ', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2420, 52, 16, 2, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2421, 52, 25, 1, 'His competitive nature influences other team members to work hard and achieve their individual goals so our team performance will be better.', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
(2422, 52, 26, 1, '', '2017-03-08 12:36:16', '2017-03-08 12:36:16'),
