(2424, 36, 2, 2, '', '2017-03-08 14:16:01', '2017-03-08 14:16:01'),
(2425, 36, 3, 2, 'Jake can handle pressure although he needs to improve his decision making skills. He evaluates new changes although his strong reluctance sometimes to adapt to these changes may influence negatively other team members. Once he see and understand the new process or changes completely, he will follow and work hard to adapt to it. ', '2017-03-08 14:16:01', '2017-03-08 14:16:01'),
(2426, 36, 4, 2, '', '2017-03-08 14:16:01', '2017-03-08 14:16:01'),
