(2472, 54, 10, 3, '', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2473, 54, 11, 3, 'Kat was able to achieve the target goals despite personal issues that contributed to lack of focus sometimes at work.  She needs to be consistent and to work hard in improving her communication skills to be more efficient and effective. She readily accepts accountability for her own actions. ', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2474, 54, 12, 3, '', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2475, 54, 15, 3, 'Kat participates in formulating ways on how to  improve her performance. She needs to be more flexible in handling and adjusting to different kind of customers and concerns. ', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2476, 54, 16, 3, '', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2477, 54, 25, 3, 'Actively participates in giving insights with group activities and achieving team goals. She needs to be more mindful of what she say and needs to control her emotions to avoid conflicts and issues in the future.  ', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2478, 54, 26, 3, '', '2017-03-30 20:30:30', '2017-03-30 20:30:30'),
(2479, 27, 1, 1, 'Robin is  very observant with his break schedules and properly notifies if he cannot report to work. ', '2017-03-30 21:06:14', '2017-03-30 21:06:14'),
(2480, 27, 2, 1, '', '2017-03-30 21:06:14', '2017-03-30 21:06:14'),
(2481, 27, 3, 2, 'Robin can handle pressure and  readily evaluates new processed and the possible issues it may cause. ', '2017-03-30 21:06:14', '2017-03-30 21:06:14'),
(2482, 27, 4, 2, '', '2017-03-30 21:06:14', '2017-03-30 21:06:14'),
(2483, 27, 5, 2, 'Robin has a good communication skills and can still improve it by giving explanations in a brief and more concise manner.  His willingness to help, whether colleague or the customer, and his initiative to remind the team of any updates is commendable.', '2017-03-30 21:06:14', '2017-03-30 21:06:14'),
(2484, 27, 6, 2, '', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2485, 27, 9, 2, 'Robin can easily identify potential problems and suggest possible solution. His willingness  to help anyone who has a complicated issues make her one of the valuable member of the team.', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2486, 27, 10, 2, '', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2487, 27, 11, 2, 'Robin is very focused at work and highly knowledgeable. He readily accepts accountability for his own actions.  One metric that he needs to be consistent is lower handling time.', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2488, 27, 12, 2, '', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2489, 27, 15, 3, 'He can anticipate probable issue and how it can greatly impact everyone in general. He is proactive in giving suggestions on how certain goal can be achieved ', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2490, 27, 16, 3, '', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2491, 27, 25, 2, 'He actively participates with group discussion especially on how to achieve the goals for our team. He gets along with everybody and willing to lend a helping hand especially with complicated issues.', '2017-03-30 21:06:15', '2017-03-30 21:06:15'),
(2492, 27, 26, 2, '', '2017-03-30 21:06:15', '2017-03-30 21:06:15');
INSERT INTO `evalDetail` (`id`, `evalForm_id`, `competency__Attribute_id`, `ratingScale_id`, `attributeValue`, `created_at`, `updated_at`) VALUES
(2493, 49, 1, 1, 'Benjamin is very observant in following his breaks and schedules. He has incurred several absences during this evaluation period so he needs to take extra care of his health. ', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2494, 49, 2, 1, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2495, 49, 3, 2, 'He can handle pressure.  He evaluates new changes although his strong reluctance sometimes to adapt to these changes may influence negatively other team members. Once he see and understand the new process or changes completely, he will follow and work hard to adapt to it. ', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2496, 49, 4, 2, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2497, 49, 5, 3, 'Benjamin needs to improve his English communication skills to be able to assist customers more effectively. He also needs to make sure that all of his calls are documented. ', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2498, 49, 6, 3, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2499, 49, 9, 3, 'Benjamin can distinguish potential issues . He needs to be more self-reliant or independent in digging deeper into the real cause of an issue. He needs to probe more to better understand the issue and be more confident with his decisions in resolving it.', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2500, 49, 10, 3, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2501, 49, 11, 2, 'He tried his best to achieve the performance goals. He readily accepts accountability for any of his actions. He needs to make sure that if he promised to call back a member or follow up even if there is no update, he will contact them to avoid further escalations. ', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2502, 49, 12, 2, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2503, 49, 15, 3, 'He participates with work - related or group activity planning and his contribution is beneficial in achieving these goals.', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2504, 49, 16, 3, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2505, 49, 25, 3, 'He participates with group discussions and a teamplayer.  Benjamin needs to control his temper at times to avoid conflicts and misunderstanding.', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2506, 49, 26, 3, '', '2017-03-30 21:13:19', '2017-03-30 21:13:19'),
(2507, 51, 1, 2, 'Francis properly notifies if he cannot report to work and observe break schedules.', '2017-03-30 21:39:17', '2017-03-30 21:39:17'),
(2508, 51, 2, 2, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2509, 51, 3, 1, 'His ability to handle pressure and adapt to rapidly changing circumstances is commendable. His schedule has gone a drastic change, he understood the need for these changes and still maintained a positive outlook.', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2510, 51, 4, 1, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2511, 51, 5, 2, 'He has good communication skills and can still improve it by giving explanations in a brief and more concise manner.', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2512, 51, 6, 2, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2513, 51, 9, 2, 'He can quickly recognize possible issues that may arise and also gives suggestions on how to resolve it. ', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2514, 51, 10, 2, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2515, 51, 11, 2, 'His performance greatly improved during this evaluation period and he became more focused at work. The recent changes that happened to him at work has helped him improve his product knowledge.', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2516, 51, 12, 2, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2517, 51, 15, 3, 'He has the ability to achieve his goals at work and can anticipate probable issues.  ', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2518, 51, 16, 3, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2519, 51, 25, 2, 'Francis participates with group discussions and gets along with everyone on the team. ', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
(2520, 51, 26, 2, '', '2017-03-30 21:39:18', '2017-03-30 21:39:18'),
