(2892, 241, 16, 3, '', '2017-06-03 15:59:04', '2017-06-03 15:59:04'),
(2893, 241, 25, 1, 'Mike displayed commitment for work as he maintained perfect Attendance since Hired Date. He still decided to report for work when VL request got declined. \n\nMike has strong communication skills which makes all needed messages to be conveyed to Customers clear that resolves all issues immediately. \n\nWould strongly recommend that Mike accepts offline duties and considers developing career in the company. Lucky to have him on the Team. ', '2017-06-03 15:59:04', '2017-06-25 13:50:27'),
(2894, 241, 26, 1, '', '2017-06-03 15:59:04', '2017-06-03 15:59:04'),
(2895, 226, 1, 2, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2896, 226, 2, 2, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2897, 226, 3, 3, 'Dexter was able to make decisions with minimal supervision. However, there are decisions made that is not aligned with the workflow we have. He also consults his lead before making the decision. He is open for process change and was able to adjust accordingly. ', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2898, 226, 4, 3, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2899, 226, 5, 3, 'Dexter shares updates and other announcements that we need to perform our job. ', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2900, 226, 6, 3, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2901, 226, 9, 3, 'He tries to work independently but there are times that he ask the same question or blockers that were answered before. He needs improvement with this part as our job usually addressing a complicated issue with a simple root cause that can be resolved by the workflows we have. ', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2902, 226, 10, 3, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2903, 226, 11, 3, '', '2017-06-03 18:38:34', '2017-06-03 18:38:34'),
(2904, 226, 12, 3, '', '2017-06-03 18:38:35', '2017-06-03 18:38:35'),
(2905, 226, 15, 3, '', '2017-06-03 18:38:35', '2017-06-03 18:38:35'),
(2906, 226, 16, 3, '', '2017-06-03 18:38:35', '2017-06-03 18:38:35'),
(2907, 226, 25, 2, 'Dexter is open for feedbacks and provides feedbacks to other as well. He also shares his thoughts for the advancement of the team. ', '2017-06-03 18:38:35', '2017-06-03 18:38:35'),
(2908, 226, 26, 2, '', '2017-06-03 18:38:35', '2017-06-03 18:38:35'),
(2909, 244, 1, 3, 'Percy is punctual schedule wise, however for additional hours like OT the person needs to improve.', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2910, 244, 2, 3, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2911, 244, 3, 3, 'the first 2 months of his tenureship under my team (Feb - May) he lacks confidence to make a decision, and shaky when pressured. Thus the agent learned how to turn things around with the help of his team lead to regain his confidence.', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2912, 244, 4, 3, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2913, 244, 5, 3, 'Percy is consistent in communicating his status. Which meets ops expectation.', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2914, 244, 6, 3, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2915, 244, 9, 3, 'When solving problems, it takes time for him to recognize\nAnalyzing problems.  Percy needs to be familiarized with the articles provided in SFDC.', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2916, 244, 10, 3, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2917, 244, 11, 3, 'Percy demonstrates commitment and continually improving. Mentorship is  what the agent need to keep him inspired.', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2918, 244, 12, 3, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2919, 244, 15, 4, 'Decision making goes hand in hand with planning. Percy needs to be more structured and plan ahead with how to execute a proper approach - This goes by studying more in his idle time and write all the important key things to keep him knowledgeable', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2920, 244, 16, 4, '', '2017-06-03 21:30:56', '2017-06-03 21:30:56'),
(2921, 244, 25, 2, 'Percy is very participative and listens proactively.', '2017-06-03 21:30:57', '2017-06-03 21:30:57'),
(2922, 244, 26, 2, '', '2017-06-03 21:30:57', '2017-06-03 21:30:57'),
