(4633, 398, 1, 2, 'Maine had no tardiness for the last 6 months. She had one absence due to health issue. She was able to notify WF and TL 2 hours before shift. It was filed as SL. There are few times when she went over-break. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4634, 398, 2, 2, 'She agreed with the score. She gave commitment to always adhere to her break schedules. She will make sure to return to avail status before her break ends. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4635, 398, 3, 2, 'When Maine was given task (extra case to escalate or to solve), she will do it within shift. She adapt to change and welcomes them positively. She does not complain right away. She tries to evaluate it first before raising up any issues to me. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4636, 398, 4, 2, 'I still needs assistance with decision making. There are times when I am still confused of the resolution that I can offer. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4637, 398, 5, 3, 'She has good relationship with her team mates. There are times when personal stuff cannot be separate from work. She needs to work on this area. When giving information to other team mates, she should always direct them first to KB or resources. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4638, 398, 6, 3, 'Sometimes, I give incomplete/outdated information/resolution. I will make sure to check KB and show them where to get the answer rather than spoon feeding them.', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4639, 398, 9, 2, 'Whenever Maine has difficult concern to solve, she utilized her tools and resources. She does not take action if there''s no valid basis and immediately reach out to supervisor if assistance is needed. She is reliable and independent. She should be actively participating on group discussions. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4640, 398, 10, 2, ' I would still like to improve on how fast I handle the concerns and resolve them.', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4641, 398, 11, 2, 'Sharmaine ranked 38 in stack rank. Her total overall score is 79.19%. ', '2017-06-21 17:33:36', '2017-07-20 15:45:00'),
(4642, 398, 12, 2, 'I consider myself as a tenure agent. I believe that I am expert with the processes and policies.', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4643, 398, 15, 2, 'Maine plans and execute the action items formulated during our coaching. When asked about development plans, she said she has no plans yet. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4644, 398, 16, 2, 'For now, she would like to focus on her agent''s stats. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4645, 398, 25, 3, 'Maine is focus more on her individual stats. She needs to mentor other teammates and engage more on huddles. It''s an opportunity for her to share her knowledge. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4646, 398, 26, 3, 'I will participate more on team huddles. ', '2017-06-21 17:33:36', '2017-06-21 17:33:36'),
(4647, 399, 1, 2, 'Kristine has 100% attendance 5/6 months since Jan-June. \nHer only absence was due to unapproved VL. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4648, 399, 2, 2, 'Kristine will file VL ahead of time. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4649, 399, 3, 2, 'Kristine accepts change positively. She evaluates new processes/information before raising any concerns. She is still considered new in the account but we can see improvement and familiarization with her product knowledge.', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4650, 399, 4, 2, 'She said that she would like to be more familiar with the product. She can do this by reading updates during avail. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4651, 399, 5, 3, 'Kristine has good relationship with her team. Her documentation is concise. She should actively participate on our huddles and should start mentoring her teammates. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4652, 399, 6, 3, 'I will be proactive in sharing my knowledge with my team mates. I will start to mentor new agents on my team. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
(4653, 399, 9, 2, 'Kristine is independent and reliable. She will use her resources and tools to solve concerns of her dashers. She still need guidance in terms of C&R. ', '2017-06-21 18:58:00', '2017-06-21 18:58:00'),
