(5407, 464, 25, 2, 'The team may be relatively new but each member, including Lyka hit it from the get go. She uses her tenure in helping her team mates in dealing with call scenarios that impose challenge and sometimes a bit of difficulty.', '2017-07-16 01:20:10', '2017-07-16 01:49:18'),
