(5409, 466, 1, 1, 'Popoy always comes in at least 15 minutes before the start of his shift. Since he joined the team, he only had one instance of absence (due to flu). He also observes break and lunch schedule religiously.', '2017-07-16 20:44:41', '2017-07-16 20:44:41'),
