(3184, ' He had personal issues last April and May. He said it''s now resolved now. He will not be absent or tardy moving forward. ', 2, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3185, 'He is low maintenance. Since he is tenured with the company, he knows how to resolve issues on his own. He immediately asks clarification or assistance when necessary. ', 3, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3186, 'We will work on his attendance. Even should come in to work 90-100% every month. ', 3, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3187, '- He will leave work 15 minutes before his usual ETD. \n- He will organize his son''s school schedule and align it with him to avoid sudden absences. \n- He will file leaves ahead of time. ', 3, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3188, '- We will monitor his attendance for the next 6 months. \n- DAs will be served for any infraction incurred. ', 3, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3189, ' Even should get an attendance of 90-100% for the next 6 months. He can do this by leaving for his work 15 minutes before his usual ETD. He will organize his son''s school schedule and align it with him to avoid sudden absences.\nHe will also work on his CSAT by using positive scripting and using power words. It sets the tone in a positive way. \n', 4, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:32'),
(3190, ' Attendance should be above 90%. His CSAT should be averaging to 80%. ', 4, 413, '2017-06-24 23:28:37', '2017-06-25 20:27:33'),
(3191, ' It''s Ejhay''s responsibility to meet his KPIs: Productivity, QA, Attendance and CSAT. He must assist dashers, customers and merchants with any issues with delivery/account. He is handling both chat/web contacts.  ', 1, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
(3192, ' His attendance and CSAT scores has been consistently above average for the last 6 months.  ', 1, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
(3193, ' His attendance and CSAT scores has been consistently above average for the last 6 months. \nProductivity- He needs to meet 4-6 cph target for the next months.  ', 2, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
(3194, ' He can meet the goal on Productivity by starting with tab and desktop management.  ', 2, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
(3195, 'He can easily learn things. His has good communication skills. If he needs to outbound, he will do it to resolve the issue. ', 3, 415, '2017-06-25 00:10:34', '2017-06-25 21:26:29'),
(3196, 'We need to work on his tab and desktop management to improve his handle time. ', 3, 415, '2017-06-25 00:10:34', '2017-06-25 21:26:29'),
(3197, '- Since it''s avail, Ejhay should close his primary tab once the case is done. \n- He should utilize his macros and templates (SFDC). \n- He needs to observe action and reference monitor layout. \n- He should close any unused tabs on his monitor.\n', 3, 415, '2017-06-25 00:10:34', '2017-06-25 21:26:29'),
(3198, '- I Will do SBS weekly to observe if He is practicing the action items identified.', 3, 415, '2017-06-25 00:10:34', '2017-06-25 21:26:29'),
(3199, '\n\nAfter 6 months, I should have increase my scorecard and consistently meet goals. My productivity should average to 4-6 cases per hour. I can do that by observing tab and desktop management to improve my handle time. I will achieve 99-100% attendance. ', 4, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
(3200, '  Productivity - 4-6 cases per hour\nAttendance - average of 99-100% ', 4, 415, '2017-06-25 00:10:34', '2017-06-25 22:04:20'),
