INSERT INTO `ratingScale` (`id`, `label`, `status`, `description`, `percentage`, `increase`, `icon`, `maxRange`, `letterGrade`, `created_at`, `updated_at`) VALUES
(1, '5', 'Outstanding Performance', '(Few employees will score consistently at this level) Overall performance is characterized by exceptionally high quality and quantity of work in the accomplishment of tasks and projects, all responsibilities and duties are conducted in a proper manner and he/she uses job related skills in a superior manner; aggressively seeks out and assumes responsibilities that are above and beyond the position requirements.', 100, 5, 'fa-star', '100.00', 'A++', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(2, '4', 'Exceeds Expectations', 'Overall performance is better than the average.  Requires a degree of supervision that is typical for the position and experience level of the employee.  All duties and responsibilities are conducted in a proper manner.  Seeks out and assumes responsibilities which are beyond the job requirements.  Efficiently uses time and resources in carrying out assignments. ', 80, 4, 'fa-thumbs-up', '97.99', 'B+', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(3, '3', 'Meets Expectations', 'Performance of most duties is adequate.  Performs tasks that are requested but rarely undertakes work outside of his/her defined area.  Requires some direction and review of major parts of assignments. ', 60, 3, 'fa-smile-o', '89.99', 'C', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(4, '2', 'Improvement Needed', ' Performance of most duties is barely adequate.  Hesitates to undertake work outside of his/her defined area.  Requires direction and review of major parts of assignments. ', 40, 2, 'fa-exclamation', '79.99', 'D-', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(5, '1', 'Unsatisfactory Performance', ' Performance rarely meets minimum acceptable standards.  Assignments are frequently done late and/or incompletely.  Detailed direction and frequent progress checks are required.  Performance is far too low and major improvement is needed. ', 20, 0, 'fa-thumbs-down', '69.99', 'F', '2017-07-19 13:38:07', '2017-07-19 13:38:07');
