INSERT INTO `summary` (`id`, `heading`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Major Areas of Responsibility (This is what you do)', 'These typically relate to the major activities that you perform on your job and/or the goals that have been established by your manager and discussed with you.  This is also an opportunity to describe noteworthy accomplishments.', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(2, 'Performance Competencies - Skills and Behaviors (This is how you do it)', 'These skills and behaviors have been identified as important for most employees.   Other skills and behaviors may be added if needed.  Please review and consider how you have demonstrated these in your job and how you might improve on these going forward.', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(3, 'Growth &amp; Development Plan', 'Employee:  Describe two or three of your top strengths and one or two growth/development opportunities.  Provide this to your Manager for discussion and review. ', '2017-07-19 13:38:07', '2017-07-19 13:38:07'),
(4, 'Performance Goals & Expectations (for next Review Period)', ' Identify three to five goals to be accomplished during the next review period by thinking of the major activities related to your job.  At the end of the review period, rate how well these goals were achieved.  Keep in mind that during the review period, goals and evaluation criteria may be revised, added, or deleted in order to best meet changing organizational needs.  This form should be helpful in completing next year’s performance review.', '2017-07-19 13:38:07', '2017-07-19 13:38:07');
